import cvAppImg from './cv-app-screenshot';
import techAndThreads from './Tech&Threads.png';

const projects = [
  {
    name: 'CV Application',
    description:
      'A site that generates a CV template. Simply fill in the form and let the app do its thing.',
    techStack: ['HTML', 'CSS', 'TypeScript', 'React'],
    repo: 'https://github.com/Stalloyde/cv-project',
    live: 'https://cv-project-self.vercel.app/',
    imageUrl: cvAppImg,
  },
  {
    name: 'Tech & Threads',
    description: 'A front-end e-commerce site',
    techStack: ['HTML', 'CSS', 'TypeScript', 'React'],
    repo: 'https://github.com/Stalloyde/shopping-cart',
    live: 'https://shopping-cart-green-one.vercel.app/',
    imageUrl: techAndThreads,
  },
];

export default projects;
